import React from 'react'
import './assests/gallery.css';

const PhotoList = ({photos, loading}) => {
    if(loading){
        return <h2>Loading...</h2>;
    }

    return (
        <ThemeContext.Consumer>
            {({theme, toggleTheme}) => (
                <button 
                    onClick={toggleTheme}
                    id = "toggle" 
                    className = "btn"
                    style={{color: theme.color, backgroundColor: theme.backgroundColor, bordorColor: theme.bordorColor}}
                >
                    Toggle Theme = {theme.name}
                </button>
            )}
        </ThemeContext.Consumer>
    )

    return (
        <div className="container mt-3" id="photo-list-container">
            <ul className="photo-list list-group mb-4">
                {photos.map(photo =>(
                    <li key={photo.id} className="imageRow list-group-item">
                        <img src={photo.url} className="img-fluid" alt="Responsive image" width="100" height="100" />
                    </li>
                ))}
            </ul>
        </div>
    )
}

export default PhotoList
